--
-- Table structure for table `asignaciones_turnos`
--

DROP TABLE IF EXISTS `asignaciones_turnos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `asignaciones_turnos` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `turno_id` bigint(20) unsigned DEFAULT NULL,
  `estado` varchar(50) DEFAULT 'activo',
  `maquina_id` bigint(20) unsigned DEFAULT NULL,
  `obra_id` bigint(20) unsigned DEFAULT NULL,
  `entrada` time DEFAULT NULL,
  `salida` time DEFAULT NULL,
  `fecha` date NOT NULL,
  `justificante_ruta` varchar(255) DEFAULT NULL,
  `horas_justificadas` decimal(4,2) DEFAULT NULL,
  `justificante_observaciones` text DEFAULT NULL,
  `justificante_subido_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `turno_id` (`turno_id`),
  KEY `fk_asignaciones_turnos_maquina` (`maquina_id`),
  KEY `fk_asignaciones_turnos_obra` (`obra_id`),
  CONSTRAINT `asignaciones_turnos_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `asignaciones_turnos_ibfk_2` FOREIGN KEY (`turno_id`) REFERENCES `turnos` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_asignaciones_turnos_maquina` FOREIGN KEY (`maquina_id`) REFERENCES `maquinas` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_asignaciones_turnos_obra` FOREIGN KEY (`obra_id`) REFERENCES `obras` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=36727 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

