:05','2025-11-14 10:45:05'),(9,24,'user','el usuario eduardo magro tiene turno para la semana que viene?',NULL,'2025-11-15 21:31:51','2025-11-15 21:31:51'),(10,24,'assistant','No tengo acceso a información sobre turnos de usuarios. ¿En qué más puedo ayudarte?','{\"requirio_sql\":false}','2025-11-15 21:31:53','2025-11-15 21:31:53'),(11,24,'user','mira en las asignaciones de turno',NULL,'2025-11-15 21:32:02','2025-11-15 21:32:02'),(12,24,'assistant','Lo siento, no tengo acceso a la información sobre asignaciones de turno. ¿En qué más puedo ayudarte?','{\"requirio_sql\":false}','2025-11-15 21:32:04','2025-11-15 21:32:04'),(13,24,'user','dime cual fue la ultima nomina que descargo eduardo magro',NULL,'2025-11-15 21:32:23','2025-11-15 21:32:23'),(14,24,'assistant','Lo siento, no tengo acceso a información sobre nóminas o descargas específicas de usuarios.','{\"requirio_sql\":false}','2025-11-15 21:32:24','2025-11-15 21:32:24'),(15,25,'user','como ficho entrada',NULL,'2025-11-17 13:16:41','2025-11-17 13:16:41'),(16,25,'assistant','Lo siento, pero no puedo ayudar con fichar entradas. Soy un asistente para consultas SQL de lectura. ¿Te gustaría hacer una consulta sobre entradas?','{\"requirio_sql\":false}','2025-11-17 13:16:43','2025-11-17 13:16:43'),(17,26,'user','como fichar entrada',NULL,'2025-11-17 13:17:00','2025-11-17 13:17:00'),(18,26,'assistant','Para fichar una entrada, debes seguir el procedimiento establecido en tu sistema ERP. Si necesitas información sobre las entradas registradas, puedo ayudarte con eso.','{\"requirio_sql\":false}','2025-11-17 13:17:02','2025-11-17 13:17:02'),(19,26,'user','como fichar entrada',NULL,'2025-11-17 13:54:57','2025-11-17 13:54:57'),(20,26,'assistant','Para fichar una entrada, necesitarías acceso a funciones de inserción en la base de datos. Te recomiendo contactar a un administrador del sistema.','{\"requirio_sql\":false}','2025-11-17 13:54:58','2025-11-17 13:54:58'),(21,26,'user','Cual es el ultimo trabajador que ha fichado',NULL,