CREATE TABLE `etiquetas` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `codigo` varchar(255) DEFAULT NULL,
  `etiqueta_sub_id` varchar(64) DEFAULT NULL,
  `planilla_id` bigint(20) NOT NULL,
  `paquete_id` bigint(20) unsigned DEFAULT NULL,
  `producto_id` bigint(20) unsigned DEFAULT NULL,
  `producto_id_2` bigint(20) unsigned DEFAULT NULL,
  `ubicacion_id` bigint(20) unsigned DEFAULT NULL,
  `operario1_id` bigint(20) unsigned DEFAULT NULL,
  `operario2_id` bigint(20) unsigned DEFAULT NULL,
  `soldador1_id` bigint(20) unsigned DEFAULT NULL,
  `soldador2_id` bigint(20) unsigned DEFAULT NULL,
  `ensamblador1_id` bigint(20) unsigned DEFAULT NULL,
  `ensamblador2_id` bigint(20) unsigned DEFAULT NULL,
  `nombre` varchar(255) NOT NULL,
  `marca` varchar(255) DEFAULT NULL,
  `numero_etiqueta` int(11) DEFAULT NULL,
  `peso` decimal(10,2) NOT NULL DEFAULT 0.00,
  `fecha_inicio` datetime DEFAULT NULL,
  `fecha_finalizacion` datetime DEFAULT NULL,
  `fecha_inicio_ensamblado` datetime DEFAULT NULL,
  `fecha_finalizacion_ensamblado` datetime DEFAULT NULL,
  `fecha_inicio_soldadura` datetime DEFAULT NULL,
  `fecha_finalizacion_soldadura` datetime DEFAULT NULL,
  `estado` varchar(255) DEFAULT 'pendiente',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `subido` tinyint(1) DEFAULT 0,
  PRIMARY KEY (`id`),
  UNIQUE KEY `etiquetas_etiqueta_sub_id_unique` (`etiqueta_sub_id`),
  KEY `planilla_id` (`planilla_id`),
  KEY `fk_etiquetas_producto_id` (`producto_id`),
  KEY `fk_etiquetas_producto_id_2` (`producto_id_2`),
  KEY `etiquetas_ubicacion_id_foreign` (`ubicacion_id`),
  KEY `etiquetas_soldador1_foreign` (`soldador1_id`),
  KEY `etiquetas_soldador2_foreign` (`soldador2_id`),
  KEY `etiquetas_ensamblador1_foreign` (`ensamblador1_id`),
  KEY `etiquetas_ensamblador2_foreign` (`ensamblador2_id`),
  KEY `fk_etiquetas_operario1` (`operario1_id`),
  KEY `fk_etiquetas_operario2` (`operario2_id`),
  KEY `etiquetas_paquete_id_foreign` (`paquete_id`),
  CONSTRAINT `etiquetas_ensamblador1_foreign` FOREIGN KEY (`ensamblador1_id`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `etiquetas_ensamblador2_foreign` FOREIGN KEY (`ensamblador2_id`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `etiquetas_ibfk_1` FOREIGN KEY (`planilla_id`) REFERENCES `planillas` (`id`) ON DELETE CASCADE,
  CONSTRAINT `etiquetas_paquete_id_foreign` FOREIGN KEY (`paquete_id`) REFERENCES `paquetes` (`id`) ON DELETE SET NULL,
  CONSTRAINT `etiquetas_soldador1_foreign` FOREIGN KEY (`soldador1_id`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `etiquetas_soldador2_foreign` FOREIGN KEY (`soldador2_id`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `etiquetas_ubicacion_id_foreign` FOREIGN KEY (`ubicacion_id`) REFERENCES `ubicaciones` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_etiquetas_operario1` FOREIGN KEY (`operario1_id`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_etiquetas_operario2` FOREIGN KEY (`operario2_id`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_etiquetas_producto_id` FOREIGN KEY (`producto_id`) REFERENCES `productos` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_etiquetas_producto_id_2` FOREIGN KEY (`producto_id_2`) REFERENCES `productos` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=235480 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
