DROP TABLE IF EXISTS `productos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `productos` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `codigo` varchar(20) DEFAULT NULL,
  `producto_base_id` bigint(20) unsigned DEFAULT NULL,
  `fabricante_id` bigint(20) unsigned DEFAULT NULL,
  `distribuidor_id` bigint(20) unsigned DEFAULT NULL,
  `obra_id` bigint(20) unsigned DEFAULT NULL,
  `n_colada` varchar(255) DEFAULT NULL,
  `colada_id` bigint(20) unsigned DEFAULT NULL,
  `n_paquete` varchar(255) DEFAULT NULL,
  `peso_inicial` decimal(10,2) NOT NULL,
  `peso_stock` decimal(10,2) NOT NULL,
  `estado` varchar(50) DEFAULT NULL,
  `fecha_consumido` datetime DEFAULT NULL,
  `consumido_by` bigint(20) unsigned DEFAULT NULL,
  `otros` text DEFAULT NULL,
  `ubicacion_id` bigint(20) unsigned DEFAULT NULL,
  `maquina_id` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `deleted_at` timestamp NULL DEFAULT NULL,
  `entrada_id` bigint(20) unsigned DEFAULT NULL,
  `updated_by` bigint(20) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `codigo` (`codigo`),
  KEY `ubicacion_id` (`ubicacion_id`),
  KEY `maquina_id` (`maquina_id`),
  KEY `fk_productos_productos_base` (`producto_base_id`),
  KEY `productos_distribuidor_id_foreign` (`distribuidor_id`),
  KEY `fk_productos_entrada_id` (`entrada_id`),
  KEY `fk_updated_by_productos` (`updated_by`),
  KEY `consumido_by` (`consumido_by`),
  KEY `fk_productos_obra` (`obra_id`),
  KEY `productos_fabricante_id_foreign` (`fabricante_id`),
  KEY `productos_colada_id_foreign` (`colada_id`),
  CONSTRAINT `fk_productos_entrada_id` FOREIGN KEY (`entrada_id`) REFERENCES `entradas` (`id`),
  CONSTRAINT `fk_productos_obra` FOREIGN KEY (`obra_id`) REFERENCES `obras` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_productos_productos_base` FOREIGN KEY (`producto_base_id`) REFERENCES `productos_base` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_updated_by_productos` FOREIGN KEY (`updated_by`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `productos_colada_id_foreign` FOREIGN KEY (`colada_id`) REFERENCES `coladas` (`id`) ON DELETE SET NULL,
  CONSTRAINT `productos_distribuidor_id_foreign` FOREIGN KEY (`distribuidor_id`) REFERENCES `distribuidores` (`id`) ON DELETE SET NULL,
  CONSTRAINT `productos_fabricante_id_foreign` FOREIGN KEY (`fabricante_id`) REFERENCES `fabricantes` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `productos_ibfk_1` FOREIGN KEY (`ubicacion_id`) REFERENCES `ubicaciones` (`id`) ON DELETE SET NULL,
  CONSTRAINT `productos_ibfk_2` FOREIGN KEY (`maquina_id`) REFERENCES `maquinas` (`id`) ON DELETE SET NULL,
  CONSTRAINT `productos_ibfk_3` FOREIGN KEY (`consumido_by`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=651 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;
